import { createSlice } from '@reduxjs/toolkit';

const membersSlice = createSlice({
  name: 'members',
  initialState: [],
  reducers: {
    setMembers: (state, action) => {
      return action.payload;
    },
  },
});

export const { setMembers } = membersSlice.actions;
export default membersSlice.reducer;
